Was sent these two CBD lip balms from @lala.leaf and could not have come at a better time. The winter chill has hit eastern PA and my lips are taking a beating. These balms go on super smooth with a refreshing hint of peppermint or wintergreen. Love the neutral but also love a pop of red for when I’m feeling frisky. 

Perfect stocking stuffer, white elephant or treat for yourself 💋

@lala.leaf products are formulated with 100% all-natural ingredients and are Vegan, Paraben Free, Phthalate Free, Gluten Free, cruelty free, and THC Free. They use the optimal amount of CBD, and products are verified using a third-party lab report.
